import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // Step 1: Perform a search to display the sort filter controls
    await page.locator('#searchInput').fill('electronics');
    await page.locator('button.search-btn').first().click();

    // Wait for the search results and sort controls to be visible
    await page.waitForSelector('#sortSelect');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    // Step 2: Apply the "Price: High to Low" sort filter
    await page.locator('#sortSelect').selectOption('price-high');

    // Wait for the sorting to be applied (a notification appears briefly)
    await page.waitForSelector('.notification.info:has-text("Sorted by Price: High to Low")');
    await page.waitForTimeout(500); // Allow time for DOM update
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_price_sort.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_price_sort.png'));

    // Step 3: Extract product prices to verify the sort order
    const priceElements = await page.locator('.products-grid .product-card .product-price').all();
    const prices = [];
    for (const el of priceElements) {
      const priceText = await el.textContent();
      // Extract the main price, ignoring original price if present
      const priceMatch = priceText.trim().match(/^\$(\d+\.?\d*)/);
      if (priceMatch && priceMatch[1]) {
        prices.push(parseFloat(priceMatch[1]));
      }
    }

    // Verify that the prices are sorted in descending order
    let isSorted = true;
    for (let i = 0; i < prices.length - 1; i++) {
      if (prices[i] < prices[i + 1]) {
        isSorted = false;
        break;
      }
    }

    if (!isSorted) {
      throw new Error('Products are not sorted by price from high to low.');
    }

    return {
      success: true,
      action: "Successfully applied 'Price: High to Low' sort filter and verified the order.",
      extractedData: {
        productPrices: prices,
        isSortedCorrectly: isSorted
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));

    return {
      success: false,
      action: "Failed to apply price sort filter.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
